import React from 'react';
import { Jumbotron, Container } from 'reactstrap';

import banner from '../img/banner.hpg';

const Banner = (props) => {
  return (
    <div>
      <Jumbotron className="banner" fluid>
        <Container fluid>
          <h1 className="display-3">Fluid jumbotron</h1>
        </Container>
      </Jumbotron>
    </div>
  );
};

export default Banner;
